import React, { Component } from 'react';

import './styles.scss';

import Check from '../../../assets/icons/check.png';

import Current2 from '../../../assets/icons/2-foco.png';
import Current3 from '../../../assets/icons/3-foco.png';
import Current4 from '../../../assets/icons/4-foco.png';

import Disabled3 from '../../../assets/icons/3-inativo.png';
import Disabled4 from '../../../assets/icons/4-inativo.png';

const images = {
    check: Check,
    current: {
        2: Current2,
        3: Current3,
        4: Current4
    },
    disabled: {
        3: Disabled3,
        4: Disabled4
    }
}
class TimelineCadastro extends Component {

    getImg = (step, current) => {
        if ( step < current )
            return images.check
        if ( step === current)
            return images.current[step]
        return images.disabled[step]
    }

    render() {
        return (
            <div className="containerTimeline">
                <div className="contentTimeline">
                    <div className="containerState">
                        <span className="stateContent" style={ {backgroundImage: `url(${this.getImg(1 , this.props.current)})` } }></span>
                        <p className="paragrafy">Seu NÃºmero</p>
                    </div>
                    <div className="containerState">
                        <span className="stateContent" style={ {backgroundImage: `url(${this.getImg(2 , this.props.current)})` } }></span>
                        <p className="paragrafy">Seus Dados</p>
                    </div>
                    <div className="containerState">
                        <span className="stateContent" style={ {backgroundImage: `url(${this.getImg(3 , this.props.current)})` } }></span>
                        <p className="paragrafy">Seus Consoles</p>
                    </div>
                    <div className="containerState">
                        <span className="stateContent" style={ {backgroundImage: `url(${this.getImg(4 , this.props.current)})` } }></span>
                        <p className="paragrafy">Termos de Uso</p>
                    </div>
                </div>
            </div>
        )
    }
}

export default TimelineCadastro;
